import React from 'react'

const Card = (props) =>
{
     const { image, title, discription, goto } = props;
    return (
        <div className='card'>
            <div className='card__img'>
                <img src={ `${image }`} alt={ title}/>
            </div>
            <div className='card__text' >   
                <h1 className='card__heading mt'>{ title}</h1>
                    {!!discription && (
					<p className='card__paragraph mt'>{discription}</p>
                ) }
                <a href={`${goto}`}></a>
            <div className='btn mt'> <button>button</button></div>
            </div>

        </div>
    )
}

export default Card
